import { useState, useEffect } from "react";


const ContactList = () => {
    const contacts = [
        {
            id: 1,
            name: "Jane",
            phoneNum: "374-2312-245"
        }
]
const [data,setData] = useState(contacts)

    return(
        <div className="contactList">
                { data.map((unit) => {
                <div className="contact" key={unit.id}>
                    <h2>{ unit.name }</h2>
                </div>
            })}
        </div> 
    )
}
export default ContactList
